import React from "react";
import { stories } from "../constants";
import { Link } from "react-router-dom";

const Stories = () => {
  return (
    <div className="pagecenter-x pb-40">
      <h1 className="title">Customer Stories</h1>
      <section className="mt-8 grid md:grid-cols-3 gap-5">
        {stories.map((item, index) => {
          return (
            <Link to={item.path}>
              <img
                src={item.cover}
                alt={item.title}
                className="w-full h-40 bg-fullobject"
              />
              <h6 className="title-sm">item.title</h6>
              <p className="text-slate-500">{item.uploadDate}</p>
            </Link>
          );
        })}
      </section>
    </div>
  );
};

export default Stories;
